INSERT INTO `pages` VALUES (1,'About us','importance-of-feedback','Importance of feedback',NULL,'Genuine customer feedback provides extremely valuable insight for businesses. Both good and bad feedback is essential. It facilitates companies to correct errors, better the good and keep up with the consumer trends. More often than not it is an all-round value adding process.\n\nHowever research shows that for every customer complaint there are 26 other unhappy customers who remained silent. This proves that little feedback is given by customers. Frustrating process, distrust for follow up on feedback given, lengthy â¦ , are among other challenges faced by customers giving feedback.\n\nA public feedback platform will eliminate some of the problems in that it is independent, less biased, allows sharing, transparent and possibly faster against one on one feedback. This will better the overall effect on customer service and value creation.\n\nKenya does not have a forum like this, leaving companies not accountable and paying less attention on customer service. We would like to challenge and change this. {Name} is the platform that will give the customer in Kenya the chance to give ratings, Kudos and also challenge those that do not deliver. Customers are therefore encouraged â¦ Come all let\'s give a ranking. We deserve better!',NULL,'2014-06-28 08:31:56','2014-06-28 08:31:56','index'),(2,'About us','how-we-work','How we work',NULL,'Genuine customer feedback provides extremely valuable insight for businesses. Both good and bad feedback is essential. It facilitates companies to correct errors, better the good and keep up with the consumer trends. More often than not it is an all-round value adding process.\n\nHowever research shows that for every customer complaint there are 26 other unhappy customers who remained silent. This proves that little feedback is given by customers. Frustrating process, distrust for follow up on feedback given, lengthy â¦ , are among other challenges faced by customers giving feedback.\n\nA public feedback platform will eliminate some of the problems in that it is independent, less biased, allows sharing, transparent and possibly faster against one on one feedback. This will better the overall effect on customer service and value creation.\n\nKenya does not have a forum like this, leaving companies not accountable and paying less attention on customer service. We would like to challenge and change this. {Name} is the platform that will give the customer in Kenya the chance to give ratings, Kudos and also challenge those that do not deliver. Customers are therefore encouraged â¦ Come all let\'s give a ranking. We deserve better!',NULL,'2014-06-28 08:31:56','2014-06-28 08:31:56','index'),(3,'About us','terms-of-use','Terms of use',NULL,'Genuine customer feedback provides extremely valuable insight for businesses. Both good and bad feedback is essential. It facilitates companies to correct errors, better the good and keep up with the consumer trends. More often than not it is an all-round value adding process.\n\nHowever research shows that for every customer complaint there are 26 other unhappy customers who remained silent. This proves that little feedback is given by customers. Frustrating process, distrust for follow up on feedback given, lengthy â¦ , are among other challenges faced by customers giving feedback.\n\nA public feedback platform will eliminate some of the problems in that it is independent, less biased, allows sharing, transparent and possibly faster against one on one feedback. This will better the overall effect on customer service and value creation.\n\nKenya does not have a forum like this, leaving companies not accountable and paying less attention on customer service. We would like to challenge and change this. {Name} is the platform that will give the customer in Kenya the chance to give ratings, Kudos and also challenge those that do not deliver. Customers are therefore encouraged â¦ Come all let\'s give a ranking. We deserve better!',NULL,'2014-06-28 08:31:56','2014-06-28 08:31:56','index'),(4,'csr','csr','CSR',NULL,NULL,NULL,'2014-06-28 08:31:56','2014-06-28 08:31:56','csr');
